const menuItems = {
    items: [
        {
            id: 'navigation',
            title: 'Navigation',
            type: 'group',
            icon: 'icon-navigation',
            children: [
                {
                    id: 'dashboard',
                    title: 'Lista de Pacientes',
                    type: 'item',
                    url: '/app/dashboard/default',
                    icon: 'feather icon-home'
                },
                {
                    id: 'dashboard',
                    title: 'Novo Paciente',
                    type: 'item',
                    url: '/app/dashboard/default',
                    icon: 'feather icon-home'
                },
                {
                    id: 'forms',
                    title: 'Configurações',
                    type: 'item',
                    url: '/forms/form-basic',
                    icon: 'feather icon-file-text'
                },
                {
                    id: 'forms',
                    title: 'Notificações',
                    type: 'item',
                    url: '/forms/form-basic',
                    icon: 'feather icon-file-text'
                }
            ]
        }        
    ]
};

export default menuItems;
